in_source: |-
  section .text
    .start:
        ld r1 0
        ld r2 1
        ld r3 3
        ld r5 5
        ld r4 0
        ld r7 1000
    .loop:
        mv r2 r6
        mod r6 r3
        cmp r6 r4
        je .summ

        mv r2 r6
        mod r6 r5
        cmp r6 r4
        jne .next
    .summ:
        add r1 r2
    .next:
        inc r2
        cmp r2 r7
        jl .loop
    st r1 [OUT]
    halt
